import withLayout from '../components/Layout';
import Content from '../components/Content';

// eventually make an api call with these ids
const listOfBlogs = ['hello-next', 'chrome-tricks', 'css-bugs', 'deploying-with-digital-ocean'];

const Blog = () => {
  return (
    <span>
      <h1>My Blog</h1>
      <ul>
        {listOfBlogs.forEach(blogId => {
          <Content id={blogId} />
        })}
      </ul>
    </span>

  )
} 

export default withLayout(Blog);
